var http = require('http');
var webrtc = require('wrtc');
var ws = require('ws');

var MAX_REQUEST_LENGHT = 1024;
var pc = null;
var offer = null;
var answer = null;
var remoteReceived = false;

var dataChannelSettings = {
    'reliable': {
        ordered: false,
        maxRetransmits: 0
    }
};

var pendingDataChannels = {};
var dataChannels = {}
var pendingCandidates = [];

var socketPort = 9001;

var images = [
    // {
    //     name: "nuelspotlight_1",
    //     url: "http://euw.leagueoflegends.com/sites/default/files/styles/wide_small/public/upload/nuelspotlight_1.png",
    //     imageBase64: "data:image/jpg;base64,"
    // },
    {
        name: "arcligh_velkoz_splash_1920",
        url: "http://euw.leagueoflegends.com/sites/default/files/styles/wide_small/public/upload/arcligh_velkoz_splash_1920.jpg",
        imageBase64: "data:image/jpg;base64,"
    },
    {
        name: "ryze_kasadin_champ_update_large_30.01.15",
        url: "http://euw.leagueoflegends.com/sites/default/files/styles/wide_small/public/upload/ryze_kasadin_champ_update_large_30.01.15.jpg",
        imageBase64: "data:image/jpg;base64,"
    },
    {
        name: "tristanacs_spotlight_thumbnail_en_us_final_1",
        url: "http://euw.leagueoflegends.com/sites/default/files/styles/wide_small/public/upload/tristanacs_spotlight_thumbnail_en_us_final_1.jpg",
        imageBase64: "data:image/jpg;base64,"
    }
];

var wss = new ws.Server({
    'port': socketPort
});

wss.on('connection', function(ws) {
    console.info('ws connected');

    function doComplete() {
        console.info('complete');
    }

    function doHandleError(error) {
        throw error;
    }

    function doCreateAnswer() {
        remoteReceived = true;
        pendingCandidates.forEach(function(candidate) {
            if (candidate.sdp) {
                pc.addIceCandidate(new webrtc.RTCIceCandidate(candidate.sdp));
            }
        });
        pc.createAnswer(
            doSetLocalDesc,
            doHandleError
        );
    };

    function doSetLocalDesc(desc) {
        answer = desc;
        console.info(desc);
        pc.setLocalDescription(
            desc,
            doSendAnswer,
            doHandleError
        );
    };

    function doSendAnswer() {
        ws.send(JSON.stringify(answer));
        console.log('awaiting data channels');
    }

    function doHandleDataChannels() {
        var labels = Object.keys(dataChannelSettings);
        pc.ondatachannel = function(evt) {
            var channel = evt.channel;

            console.log('ondatachannel', channel.label, channel.readyState);
            var label = channel.label;
            pendingDataChannels[label] = channel;
            channel.binaryType = 'arraybuffer';

            channel.onopen = function() {
                console.info('onopen');
                dataChannels[label] = channel;

                delete pendingDataChannels[label];

                if (Object.keys(dataChannels).length === labels.length) {
                    doComplete();
                }

                i = 0;
                channel.send(JSON.stringify({
                    image: images[i % images.length].imageBase64,
                    url: images[i % images.length].url,
                    name: images[i % images.length].name
                }));
                setInterval(function() {
                    channel.send(JSON.stringify({
                        image: images[i % images.length].imageBase64,
                        url: images[i % images.length].url,
                        name: images[i % images.length].name
                    }));

                    i++;
                }, 5000);
            };

            channel.onmessage = function(evt) {
                var data = evt.data;
                console.log('onmessage:', evt.data);
            };

            channel.onclose = function() {
                console.info('onclose');
            };

            channel.onerror = doHandleError;
        };
        doSetRemoteDesc();
    };

    function doSetRemoteDesc() {
        console.info(offer);
        pc.setRemoteDescription(
            offer,
            doCreateAnswer,
            doHandleError
        );
    }

    ws.on('message', function(data) {
        data = JSON.parse(data);
        if ('offer' == data.type) {
            offer = new webrtc.RTCSessionDescription(data);
            answer = null;
            remoteReceived = false;

            pc = new webrtc.RTCPeerConnection({
                iceServers: [{
                    url: 'stun:stun.l.google.com:19302'
                }]
            }, {
                'optional': [{
                    DtlsSrtpKeyAgreement: false
                }]
            });
            pc.onsignalingstatechange = function(state) {
                console.info('signaling state change:', state);
            }
            pc.oniceconnectionstatechange = function(state) {
                console.info('ice connection state change:', state);
            }
            pc.onicegatheringstatechange = function(state) {
                console.info('ice gathering state change:', state);
            }
            pc.onicecandidate = function(candidate) {
                ws.send(JSON.stringify({
                    'type': 'ice',
                    'sdp': {
                        'candidate': candidate.candidate,
                        'sdpMid': candidate.sdpMid,
                        'sdpMLineIndex': candidate.sdpMLineIndex
                    }
                }));
            }

            doHandleDataChannels();
        } else if ('ice' == data.type) {
            if (remoteReceived) {
                if (data.sdp.candidate) {
                    pc.addIceCandidate(new webrtc.RTCIceCandidate(data.sdp.candidate));
                }
            } else {
                pendingCandidates.push(data);
            }
        }
    });
});
